import { Outlet } from 'react-router-dom';
import { ThemeProvider, styled } from 'styled-components';
import theme from './styles/theme';


const Box = styled.div`
  min-width: 300px;
  max-width: 800px;
  background-color: lightblue;
`

function App() {
    return (
        <ThemeProvider theme={theme}>
            <GlobalStyle />
            <>
                <Outlet />
            </>
        </ThemeProvider>
    );
}

export default App;
